const Contact = () => {
    return (
        <div className="absolute left-10 top-20">
            <h1 className="break-normal font-semibold text-7xl text-blue-900">This is the Contact component.</h1>
            <h1 className="break-normal font-semibold text-7xl text-blue-900">Tenisha will work on this.</h1>
            <Subcomponent />
        </div>

    );
}

export default Contact;
